import Link from 'next/link'

const linkStyle = {
    marginRight: 15
}


function navProps () {
    return [
      { href: '/', text: 'Home'},
      { href: '/about', text: 'About'},
      { href: '/inventory', text: 'Inventory'},
    ]
}

const NavLink = ({navProp}) => (
    <li>
        <Link href={navProp.href}>
            <a>{navProp.text}</a>
        </Link>
        <style jsx>{`
          li {
            list-style: none;
            margin: 5px 0;
          }

          a {
            text-decoration: none;
            color: blue;
            font-family: "Arial";
          }

          a:hover {
            opacity: 0.6;
          }
        `}</style>
    </li>
)
const NavLinks = () => (
    <ul>
        {navProps().map((navProp) => (
            <NavLink navProp={navProp}/>
        ))}
    </ul>
)

const Header = () => (
    <div>
        <NavLinks />
    </div>
)

export default Header
